import React from 'react';
import { Typography, Button } from '@material-ui/core';

const HomeStart = () => {
    return (
        <div style={{backgroundColor: '#f4f5f7'}}>
            <div className="mycontainer homeStart">
                <Typography variant="h4" style={{ padding: '2rem 0 1.2rem' }}>
                    ساخته شده برای تیم های حرفه ای
                </Typography>
                <Typography variant="h6" style={{ padding: '.1rem 0 .7rem' }}>
                    بیت‌باکت بیش از گیت مدیریت کد است. بیت‌باکت تیم ها را برای برنامه ریزی پروژه ها، همکاری در کد، تست و استقرار می دهد.
                </Typography>
                <Button variant="contained" color="primary" style={{ padding: '.1rem 0 .7rem' }}>
                    شروع کنید
                </Button>
                <img src={require('./img/HeroImage.png')} style={{width: '100%'}} />
            </div>
        </div>
    )
}

export default HomeStart;
